import Navbar from "./components/navbar";
import Main from "./components/main";
import SingleCourse from './components/course';

const App = () => {
  return (
    <>
      <div className="gridContainer">
        <Navbar />
        <div className="middleContainer">
          <Main />
        </div>
      </div>
    </>
  );
};

export default App;
